[{"operationName":"BannerAdCampaignsV1Query","variables":{"placement":"MEGAMENU","bannerCount":2},"query":"query BannerAdCampaignsV1Query($placement: String!, $bannerCount: Int!) {
  BannerAdCampaignsV1Resource {
    byPlacement(placement: $placement, bannerCount: $bannerCount) {
      elements {
        id
        callToActionUrl
        placement
        promotedEntityId
        creative {
          imageUrl
          partnerName
          titleText
          bodyText
          callToActionText
          backgroundColor
          __typename
        }
        __typename
      }
      __typename
    }
    __typename
  }
}
"},{"operationName":"ProfessionalCertificatesData","variables":{},"query":"query ProfessionalCertificatesData {
  ProfessionalCertsV1Resource {
    getAll {
      elements {
        id
        name
        slug
        tagline
        partnerSquareLogo
        thumbnail
        __typename
      }
      __typename
    }
    __typename
  }
}
"},{"operationName":"degreeListsQuery","variables":{"liveOnly":true,"contextType":"PAGE","contextId":"logged-out"},"query":"query degreeListsQuery($contextType: String!, $contextId: String!, $liveOnly: Boolean!) {
  DegreeListsV1Resource {
    getList(contextType: $contextType, contextId: $contextId) {
      elements {
        id
        slugs
        __typename
      }
      __typename
    }
    __typename
  }
  CatalogDegreesV1Resource {
    getAll(liveOnly: $liveOnly) {
      elements {
        id
        name
        slug
        languageCode
        bannerImage
        marketingName
        catalogAvailabilityStatus
        partners {
          elements {
            id
            shortName
            name
            productBrandingLogo
            squareLogo
            landingPageBanner
            primaryColor
            __typename
          }
          __typename
        }
        partnerIds
        domainIds
        __typename
      }
      __typename
    }
    __typename
  }
}
"},{"operationName":"DomainGetAllQuery","variables":{},"query":"query DomainGetAllQuery {
  DomainsV1Resource {
    domains: getAll {
      elements {
        id
        slug
        name
        description
        backgroundImageUrl
        subdomains {
          elements {
            id
            slug
            name
            domainId
            description
            __typename
          }
          __typename
        }
        __typename
      }
      __typename
    }
    __typename
  }
}
"}]
